    return $font_family;
}

function sfm_get_font_weight_choices($family) {
    if ($family) {
        $sfm_standard_font = sfm_standard_font_array();
        $sfm_google_font = sfm_google_font_array();

        $sfm_font = array_merge($sfm_standard_font, $sfm_google_font);

        $font_array = sfm_search_key($sfm_font, 'family', $family);

        $variants_array = $font_array['0']['variants'];
        return $variants_array;
    } else {
        return array(
            '400' => esc_html__('Normal', 'simple-floating-menu'),
            '700' => esc_html__('Bold', 'simple-floating-menu')
        );
    }
}

function sfm_get_text_transform_choices() {
    return array(
        'none' => esc_html__('None', 'simple-floating-menu'),
        'uppercase' => esc_html__('Uppercase', 'simple-floating-menu'),
        'lowercase' => esc_html__('Lowercase', 'simple-floating-menu'),
        'capitalize' => esc_html__('Capitalize', 'simple-floating-menu')
    );
}

function sfm_get_text_decoration_choices() {
    return array(
        'none' => esc_html__('None', 'simple-floating-menu'),
        'underline' => esc_html__('Underline', 'simple-floating-menu'),
        'line-through' => esc_html__('Line-through', 'simple-floating-menu'),
        'overline' => esc_html__('Overline', 'simple-floating-menu')
    );
}

function sfm_search_key($array, $key, $value) {
    $results = array();
    if (is_array($array)) {
        if (isset($array[$key]) && $array[$key] == $value) {
            $results[] = $array;
        }
        foreach ($array as $subarray) {
            $results = array_merge($results, sfm_search_key($subarray, $key, $value));
        }
    }
    return $results;
}

function sfm_get_google_font_variants() {

    $font_list = array_merge(sfm_standard_font_array(), sfm_google_font_array());

    $font_family = sanitize_text_field($_REQUEST['font_family']);
    $font_array = sfm_search_key($font_list, 'family', $font_family);

    $variants_array = $font_array['0']['variants'];
    $options_array = "";
    foreach ($variants_array as $key => $variants) {
        $selected = $key == '400' ? 'selected="selected"' : '';
        $options_array .= '<option ' . $selected . ' value="' . $key . '">' . $variants . '</option>';
    }

    if (!empty($options_array)) {
        echo $options_array;
    } else {
        echo $options_array = '';
    }
    die();
}

add_action("wp_ajax_get_google_font_variants", "sfm_get_google_font_variants");
